import React from 'react'
import { connect } from 'react-redux'

import { EditTodo, AddTodo, DeleteTodo } from '../../Actions/todo'

function mapDispatchToProps(dispatch) {
  return {
    AddTodo: item => dispatch(AddTodo(item))
  };
}

// const mapStateToProps = state => {
//     return { todoList: state.todoList };
// };
const ConnectedList = ({ todoList }) => (

  <ul>
    {todoList.map(el => (
      <li key={el.id}>{el.content}</li>
    ))}
  </ul>

);

class TestForm extends React {
  handleAdd = () => {
    this.props.AddTodo({ id: 2, content: "this content from test.js" })
  }

  render() {
    return (
      <div >
        <div>
          {ConnectedList}
          <button onClick={this.handleAdd}>Add</button>
        </div>
      </div>
    )

  }
}

const Test = connect(mapDispatchToProps)(TestForm)
export default Test;
